import React, { Component } from "react";

import data from "./data/data.json";

const newdata = data.map(data => {
  return (
    <body>
    <div href="salad">
      <p>Plato: {data.name}</p>
      <p>Descripcion: {data.desc}</p>
    </div>
    </body>
  );
});

export default class Main extends Component {
  render() {
    return newdata;
  }
}
